var Assert={};

Assert.TableEqual=function(a, b){
	if (a.header!==undefined) a=CNV.Table2List(a);
	if (b.header!==undefined) b=CNV.Table2List(b);

	{//VERIFY COLUMNS MATCH
		var colA=SQL.getColumns(a).sort(function(a, b){return a.name > b.name ? 1 : (a.name<b.name ? -1 : 0);});
		var colB=SQL.getColumns(b).sort(function(a, b){return a.name > b.name ? 1 : (a.name<b.name ? -1 : 0);});

		for(c in colA){
			if (colA[c].name!=colB[c].name) D.error("Missing column '"+colA[c].name+"'");
		}//for
		if (colB.length!=colA.length){
			for(c in colB){
				if (colA[c].name!=colB[c].name) D.error("Missing column '"+colB[c].name+"'");
			}//for
		}//endif
	}//block

	var columns=SQL.getColumns(a);

	for(i in a.data){
		for(c in columns){
			if (a.data[i][columns[c]]!=b.data[i][columns[c]]){
				D.error("Table data does not match");
				return false;
			}//endif
		}//for
	}//for

	return true;

};